import React from 'react'

export default function Textform() {
  return (
    <div>
      <form className='container'>
  
  <div className="form-group">
    <label for="mybox">Example TextArea</label>
    <input type="text" className="form-control" id="mybox"/>
  </div>

</form>
    </div>
  )
}
